import React from "react";
import AdminAds from "./pages/adminAds/AdminAds";
import Home from "./pages/home/Home";
import { useState } from "react";
import "./pages/home/css/navbar.css";
import {
  BrowserRouter,
  Route,
  Routes,
  Link,
} from "react-router-dom";

const NavBar = () => {
  const [state, setState] = useState(false);
  const navigation = [
    { title: "التسجيل", path: "/posts" },
    { title: "تسجيل الدخول", path: "/posts" },
    { title: "إعلانات الإدارة", path: "/posts" },
    { title: "الدعم الفني", path: "/posts" },
  ];

  return (
    <nav className="nav-primary">
      <div className="nav-container">
        <div className="brand">
          <a href="/">
            <h2 className="orange">العقاب اون لاين</h2>
          </a>
          <div className="menu-btn">
            <button onClick={() => setState(!state)}>
              {state ? (
                <svg
                  xmlns="http://www.w3.org/2000/svg"
                  viewBox="0 0 20 20"
                  fill="currentColor"
                >
                  <path
                    fillRule="evenodd"
                    d="M4.293 4.293a1 1 0 011.414 0L10 8.586l4.293-4.293a1 1 0 111.414 1.414L11.414 10l4.293 4.293a1 1 0 01-1.414 1.414L10 11.414l-4.293 4.293a1 1 0 01-1.414-1.414L8.586 10 4.293 5.707a1 1 0 010-1.414z"
                    clipRule="evenodd"
                  />
                </svg>
              ) : (
                <svg
                  xmlns="http://www.w3.org/2000/svg"
                  fill="none"
                  viewBox="0 0 24 24"
                  stroke="currentColor"
                >
                  <path
                    strokeLinecap="round"
                    strokeLinejoin="round"
                    strokeWidth={2}
                    d="M4 8h16M4 16h16"
                  />
                </svg>
              )}
            </button>
          </div>
        </div>
        <div className={`nav-items ${state ? "" : "hide-nav"}`}>
          <ul>
            {navigation.map((item, idx) => {
              return (
                <li key={idx} className="nav-item">
                  <NavLink to={item.path}>{item.title}</NavLink>
                </li>
              );
            })}
          </ul>
        </div>
        <div className="get-started-link">
          <a href="/" className="">
            التحميل
          </a>
        </div>
      </div>
    </nav>
  );
};

function App() {
  return (
    <div className="App">
      <header>
        <NavBar />
      </header>
      <BrowserRouter>
        <Routes>
          <Route path="/" element={<Home />} exact />
          <Route path="/posts" element={<AdminAds />} />
        </Routes>
      </BrowserRouter>
    </div>
  );
}
export default App;
